import React from 'react'

const stickyHeader = () => {
  return(
    <div id="sticky-header">
      <div className="sticky-header-container">
        <Logo />
        <Nav links={this.state.links} />
        <CTA />
      </div>
    </div>
  )
}

export default stickyHeader;
